import React from 'react'
import Banner from './Banner';
import './Homescreen.css'
import Navbar from './Navbar';
import Row from './Row'

function Homescreen() {
  return (
    <>
     <div className='homescreen'>
         <Navbar/>
         <Banner/>
        <Row/>
      </div>
    </>
   
  )
}

export default Homescreen;
